import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './login_page.css';
import logo from './assets/logo2movfara2.png';

function LoginPage() {
  const [isRegistering, setIsRegistering] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");
  const navigate = useNavigate();

  const toggleForm = () => {
    setIsRegistering((prev) => !prev);
    setErrorMessage("");
  };

  const handleSignIn = async (event) => {
    event.preventDefault();
    const email = event.target.email.value;
    const password = event.target.password.value;

    setErrorMessage("");

    console.log("Login Attempt - Email:", email, "Password:", password); // Verificăm datele trimise

    try {
      const response = await fetch("http://localhost:5000/auth/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ email, password }),
      });

      const data = await response.json();
      
      if (response.ok) {
        localStorage.setItem("token", data.token);
        navigate("/channel");
      } else {
        setErrorMessage(data.message || "Eroare necunoscută");
        console.log('Login error response:', data);
      }
    } catch (error) {
      console.error("Error during login:", error);
      setErrorMessage("Eroare la autentificare.");
    }
  };

  const handleRegister = async (event) => {
    event.preventDefault();
    const username = event.target.username.value;
    const email = event.target.email.value;
    const password = event.target.password.value;

    setErrorMessage("");

    try {
      const response = await fetch("http://localhost:5000/auth/register", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, email, password }),
      });

      const data = await response.json();

      if (response.ok) {
        alert("Cont creat cu succes! Autentificare automată.");
        localStorage.setItem("token", data.token);
        navigate("/channel");
      } else {
        setErrorMessage(data.message || "Eroare necunoscută");
        console.log('Register error response:', data);
      }
    } catch (error) {
      console.error("Error during registration:", error);
      setErrorMessage("Eroare la înregistrare.");
    }
  };

  const checkAuthentication = () => {
    const token = localStorage.getItem("token");
    if (token) {
      navigate("/channel");
    }
  };

  useEffect(() => {
    checkAuthentication();
  }, []);

  return (
    <div className="login-container">
      <div className="login-card">
        {isRegistering ? (
          <div id="register-section" className="form-section active">
            <img src={logo} alt="Logo" className="logo" />
            <h2 className="title">Înregistrare</h2>
            <form onSubmit={handleRegister}>
              <label htmlFor="username">Nume de utilizator:</label>
              <input type="text" id="username" required />
              <label htmlFor="email">Email:</label>
              <input type="email" id="email" required />
              <label htmlFor="password">Parolă:</label>
              <input type="password" id="password" required />
              <button type="submit">Înregistrează-te</button>
              {errorMessage && <p className="error-message">{errorMessage}</p>}
            </form>
            <p className="switch-form" onClick={toggleForm}>Ai deja un cont? Autentifică-te aici</p>
          </div>
        ) : (
          <div id="login-section" className="form-section active">
            <img src={logo} alt="Logo" className="logo" />
            <h2 className="title">Autentificare</h2>
            <form onSubmit={handleSignIn}>
              <label htmlFor="email">Email:</label>
              <input type="email" id="email" required />
              <label htmlFor="password">Parolă:</label>
              <input type="password" id="password" required />
              <button type="submit">Autentifică-te</button>
              {errorMessage && <p className="error-message">{errorMessage}</p>}
            </form>
            <p className="switch-form" onClick={toggleForm}>Nu ai un cont? Înregistrează-te aici</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default LoginPage;
